import Container from 'react-bootstrap/Container';
import React from 'react';
import bgImage from './assets/bg.jpg';
import AboutMe from './about-me';
import NavigationBar from './Navbar';
import Resume from './resume';
import MyInfo from './my-info';
import Skills from './skills';
import scrollDown from './scrollDown';
import { Card, Col, Row } from 'react-bootstrap';
function Home() {
  const refHome = React.useRef(null);

  return (
    <>
      <NavigationBar refHome={refHome} />
      <div className="Home" ref={refHome}>
        <Container className="text-center mt-4">
          <img src={bgImage} alt="Background" style={{ width: '100%', height: 'auto' }} />
        </Container>
      </div>
      <br />
      <Card className="text-start mx-4">
      <Card.Body>
        <Row>
          <Col>
            <MyInfo />
          </Col>
          <Col>
            <AboutMe />
          </Col>
        </Row>
      </Card.Body>
    </Card>
    <br/>
    <br/>
    <div className="mx-4 mt-4">
      <Skills />
    </div>
    <br/>
    <br/>
    <div className="mx-4 mt-4">
      <Resume />
    </div>
    <br />

    <footer className="text-center mt-4 mb-4  color-white p-2 c">
      &copy; {new Date().getFullYear()} Ahmad Numan. All rights reserved.
      </footer>
    </>
  );
}

export default Home;
